script: |
  super -f text -I q9839.spq | sort > q9839.out

inputs:
  - name: q9839.spq
    data: |
      SELECT ALL - 77 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NULL IN ( - col2 / CAST ( CAST ( NULL AS REAL ) AS INTEGER ), col2 * - col2 + - 40, - col0 );
  - name: tab0

outputs:
  - name: q9839.out
    data: |
